import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { FaBars, FaTimes, FaPhone } from 'react-icons/fa';
import { motion } from 'framer-motion';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();

  const navItems = [
    { name: 'Home', path: '/' },
    { name: 'Services', path: '/services' },
    { name: 'About', path: '/about' },
    { name: 'Contact', path: '/contact' },
  ];

  return (
    <nav className="bg-white shadow-lg sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <Link to="/" className="flex items-center space-x-2">
            <div className="w-10 h-10 bg-primary rounded-full flex items-center justify-center">
              <span className="text-white font-bold text-lg">FF</span>
            </div>
            <span className="text-xl font-semibold text-text">Feet first foot care & wellness clinic</span>
          </Link>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            {navItems.map((item) => (
              <Link
                key={item.name}
                to={item.path}
                className={`px-3 py-2 rounded-md text-sm font-medium transition-colors ${
                  location.pathname === item.path
                    ? 'text-primary border-b-2 border-primary'
                    : 'text-text hover:text-primary'
                }`}
              >
                {item.name}
              </Link>
            ))}
            <Link
              to="/book-appointment"
              className="bg-primary text-white px-4 py-2 rounded-full hover:bg-secondary transition-colors"
            >
              Book Appointment
            </Link>
            <a
              href="tel:403-903-4293"
              className="flex items-center space-x-1 text-primary hover:text-secondary transition-colors"
            >
              <FaPhone className="w-4 h-4" />
              <span className="text-sm font-medium">403-903-4293</span>
            </a>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden">
            <button
              onClick={() => setIsOpen(!isOpen)}
              className="text-text hover:text-primary focus:outline-none"
            >
              {isOpen ? <FaTimes className="w-6 h-6" /> : <FaBars className="w-6 h-6" />}
            </button>
          </div>
        </div>

        {/* Mobile Navigation */}
        {isOpen && (
          <motion.div
            initial={{ opacity: 0, y: -20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            className="md:hidden bg-white border-t"
          >
            <div className="px-2 pt-2 pb-3 space-y-1">
              {navItems.map((item) => (
                <Link
                  key={item.name}
                  to={item.path}
                  onClick={() => setIsOpen(false)}
                  className={`block px-3 py-2 rounded-md text-base font-medium ${
                    location.pathname === item.path
                      ? 'text-primary bg-accent'
                      : 'text-text hover:text-primary hover:bg-accent'
                  }`}
                >
                  {item.name}
                </Link>
              ))}
              <Link
                to="/book-appointment"
                onClick={() => setIsOpen(false)}
                className="block w-full text-center bg-primary text-white px-3 py-2 rounded-md font-medium hover:bg-secondary transition-colors"
              >
                Book Appointment
              </Link>
              <a
                href="tel:403-903-4293"
                className="flex items-center justify-center space-x-1 text-primary hover:text-secondary transition-colors px-3 py-2"
              >
                <FaPhone className="w-4 h-4" />
                <span className="font-medium">403-903-4293</span>
              </a>
            </div>
          </motion.div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
